import React from "react";
import styled from "styled-components";

const ImageSliderContainer = styled.section`
  height: calc(92vh);
  position: relative;
  overflow: hidden;
  .temp-main {
    width: 100%;
  }
`;

const ImageSlider = () => {
  return (
    <ImageSliderContainer>
      <img className="temp-main" src="images/temp_main.jpg" />
    </ImageSliderContainer>
  );
};

export default ImageSlider;
